    "description": "<p>Draft pull requests are available in public repositories with GitHub Free and GitHub Pro, and in public and private repositories with GitHub Team and GitHub Enterprise Cloud. For more information, see <a href=\"https://help.github.com/articles/github-s-billing-plans\">GitHub's billing plans</a> in the GitHub Help documentation.</p> <p>To open or update a pull request in a public repository, you must have write access to the head or the source branch. For organization-owned repositories, you must be a member of the organization that owns the repository to open or update a pull request.</p> <p>This endpoint triggers <a href=\"https://help.github.com/articles/about-notifications/\">notifications</a>. Creating content too quickly using this endpoint may result in abuse rate limiting. See &quot;<a href=\"https://developer.github.com/v3/#abuse-rate-limits\">Abuse rate limits</a>&quot; and &quot;<a href=\"https://developer.github.com/v3/guides/best-practices-for-integrators/#dealing-with-abuse-rate-limits\">Dealing with abuse rate limits</a>&quot; for details.</p> <p><a href=\"https://developer.github.com/v3/pulls/#create-a-pull-request\">REST API doc</a></p>",
