    "description": "<p><strong>Note:</strong> Accessing this endpoint does not count against your REST API rate limit. <em>Understanding your rate limit status</em>*</p> <p>The Search API has a <a href=\"https://developer.github.com/v3/search/#rate-limit\">custom rate limit</a>, separate from the rate limit governing the rest of the REST API. The GraphQL API also has a <a href=\"/v4/guides/resource-limitations/#rate-limit\">custom rate limit</a> that is separate from and calculated differently than rate limits in the REST API.</p> <p>For these reasons, the Rate Limit API response categorizes your rate limit. Under <code>resources</code>, you'll see four objects: The <code>core</code> object provides your rate limit status for all non-search-related resources in the REST API. The <code>search</code> object provides your rate limit status for the <a href=\"https://developer.github.com/v3/search/\">Search API</a>. The <code>graphql</code> object provides your rate limit status for the <a href=\"/v4/\">GraphQL API</a>. The <code>integration_manifest</code> object provides your rate limit status for the <a href=\"https://developer.github.com/apps/building-github-apps/creating-github-apps-from-a-manifest/#3-you-exchange-the-temporary-code-to-retrieve-the-app-configuration\">GitHub App Manifest code conversion</a> endpoint.</p> <p>For more information on the headers and values in the rate limit response, see &quot;<a href=\"https://developer.github.com/v3/#rate-limiting\">Rate limiting</a>.&quot;</p> <p>The <code>rate</code> object (shown at the bottom of the response above) is deprecated.</p> <p>If you're writing new API client code or updating existing code, you should use the <code>core</code> object instead of the <code>rate</code> object. The <code>core</code> object contains the same information that is present in the <code>rate</code> object.</p> <p><a href=\"https://developer.github.com/v3/rate_limit/#get-your-current-rate-limit-status\">REST API doc</a></p>",
